        public static void Swap<T>(ref T lhs, ref T rhs)
        {
            T t = lhs;
            lhs = rhs;
            rhs = t;
        }
        public static void MakeCircle(int x, int y, float r, ushort type)
        {
            int num = (int)(x - r);
            int num2 = (int)(y - r);
            int num3 = (int)(x + r);
            int num4 = (int)(y + r);
            for (int i = num; i < num3 + 1; i++)
            {
                for (int j = num2; j < num4 + 1; j++)
                {
                    if (Vector2.Distance(new Vector2(i, j), new Vector2(x, y)) <= r)
                    {
                        if (type == 65535)
                        {
                            Main.tile[i, j].active(false);
                            Main.tile[i, j].wall = (ushort)ModContent.WallType<Walls.TuhrtlBrickWallUnsafe>();
                        }
                        else
                        {
                            Main.tile[i, j].active(true);
                            Main.tile[i, j].type = type;
                            Main.tile[i, j].wall = (ushort)ModContent.WallType<Walls.TuhrtlBrickWallUnsafe>();
                            WorldGen.SquareTileFrame(i, j, true);
                        }
                    }
                }
            }
        }
        public static void BoreTunnel(int x0, int y0, int x1, int y1, float r, ushort type)
        {
            bool flag = Math.Abs(y1 - y0) > Math.Abs(x1 - x0);
            if (flag)
            {
                Swap<int>(ref x0, ref y0);
                Swap<int>(ref x1, ref y1);
            }
            if (x0 > x1)
            {
                Swap<int>(ref x0, ref x1);
                Swap<int>(ref y0, ref y1);
            }
            int num = x1 - x0;
            int num2 = Math.Abs(y1 - y0);
            int num3 = num / 2;
            int num4 = (y0 < y1) ? 1 : -1;
            int num5 = y0;
            for (int i = x0; i <= x1; i++)
            {
                if (flag)
                {
                    MakeCircle(num5, i, r, type);
                }
                else
                {
                    MakeCircle(i, num5, r, type);
                }
                num3 -= num2;
                if (num3 < 0)
                {
                    num5 += num4;
                    num3 += num;
                }
            }
        }

        public static void CreateTuhrtlOutpost(int x, int y)
        {
            List<Vector2> startPoints = new List<Vector2>();
            List<Vector2> endPoints = new List<Vector2>();

            MakeArea(x, y); // 191 blocks tall, 167 blocks wide

            List<Vector2> med1 = SmallRoom(x + 75, y + 15);
            startPoints.Add(med1[0]); // left side of first medium room (1s)
            startPoints.Add(med1[1]); // right side of first medium room (2s)

            List<Vector2> small1 = SmallRoom(x + 30, y + 55);
            endPoints.Add(small1[1]); // right side of first small room (1e)
            startPoints.Add(small1[0]); // left side of first small room (3s)

            List<Vector2> small2 = SmallRoom(x + 100, y + 40);
            endPoints.Add(small2[0]); // left side of second small room (2e)

            List<Vector2> big1 = SmallRoom(x + 40, y + 85);
            endPoints.Add(big1[0]); // left side of big room (3e)
            startPoints.Add(big1[1]); // right side of big room (4s)

            List<Vector2> med2 = SmallRoom(x + 105, y + 110);
            endPoints.Add(med2[0]); // left side of second medium room (4e)
            startPoints.Add(med2[0]); // left side of second medium room (5s)

            endPoints.Add(LargeRoom(x + 75, y + 135)[1]); // boss room (5e)

            for (int i = 0; i < startPoints.Count; i++)
            {
                BoreTunnel((int)startPoints[i].X, (int)startPoints[i].Y, (int)endPoints[i].X, (int)endPoints[i].Y, 4, 65535);
            }
        }
    }
